import { useState } from 'react'
import emailjs from 'emailjs-com'

const initialState = {
  name: '',
  email: '',
  message: '',
}
export const Contact = (props) => {
  const [{ name, email, message }, setState] = useState(initialState)



  return (
    <div>

      <div id='footer'>
        <div className='container text-center'>
          <p>
            &copy; 2021 Seamless Capital. {' '}
            <a href='https://www.linkedin.com/company/seamlesscapital/' rel='nofollow'>
            Seamless Capital
            </a>
          </p>
        </div>
      </div>
    </div>
  )
}
